import React from 'react';

class TestUserList extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            users: []
        }
    }
    componentDidMount(){
        fetch('https://jsonplaceholder.typicode.com/users')
        .then(response => response.json())
        .then(data => this.setState({users: data(0,10)}))
    }

    render(){
        return (
            <div className='container user-list'>
                <h1>User List</h1>

            </div>
        )
    }
}
export default TestUserList
